// SPDX-License-Identifier:MIT

pragma solidity ^0.8.0;
import "@chainlink/contracts/src/v0.8/interfaces/AggregatorV3Interface.sol";
// import "./PriceConverter.sol";


contract FundMe {

// Get funds from user 
// Withdraw funds
// Set a minimum funding value in USD 

uint256 public minimumUsd =  50;

    function fund() public payable {
        // Want to be able to set a minimum fund amount in USD
         require(msg.value >= minimumUsd, "Didn't send enough");  
         // 18 Decimal places 

    }
    // https://docs.chain.link/docs/get-the-latest-price/
    function getPrice () public view returns(uint256) {
         // Interacting the contarct outside our B
         // ABI  + Address  help is to interact 
         //  ABI is get from https://github.com/smartcontractkit/chainlink using interface
         //  Address: 0x5f4eC3Df9cbd43714FE2740f5E3616155c5b8419

         AggregatorV3Interface priceFeed  =  AggregatorV3Interface(0x5f4eC3Df9cbd43714FE2740f5E3616155c5b8419);
          (, int256 price,,,)  =   priceFeed.latestRoundData();
          return uint256( price * 1e10);

          // Price of ETH in USD 

    }

    function getVersion() public view returns (uint256){
        AggregatorV3Interface priceFeed = AggregatorV3Interface(0x8A753747A1Fa494EC906cE90E9f37563A8AF630e);
        return priceFeed.version();
    }

    function getConversion (uint256 ethAmount )  public view returns (uint256) {
            uint256 ethPrice =  getPrice();
            uint256 ethAmountInUsd =  (ethPrice *ethAmount) / 1e18;
        return ethAmountInUsd;
    }

    // function withdraw(){}
}

@chainlink/contracts/src/v0.8/interfaces.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

interface AggregatorV3Interface {
  function decimals() external view returns (uint8);

  function description() external view returns (string memory);

  function version() external view returns (uint256);

  // getRoundData and latestRoundData should both raise "No data present"
  // if they do not have data to report, instead of returning unset values
  // which could be misinterpreted as actual reported values.
  function getRoundData(uint80 _roundId)
    external
    view
    returns (
      uint80 roundId,
      int256 answer,
      uint256 startedAt,
      uint256 updatedAt,
      uint80 answeredInRound
    );

  function latestRoundData()
    external
    view
    returns (
      uint80 roundId,
      int256 answer,
      uint256 startedAt,
      uint256 updatedAt,
      uint80 answeredInRound
    );
}

